// src/services/ContractAPI.ts
import { ethers } from 'ethers';
import type { AbiItem } from 'web3-utils'; // or drop this and use your own ABI type

export class ContractAPI {
  private contract!: ethers.Contract;
  private signerOrProvider: ethers.Signer | ethers.providers.Provider;

  constructor(
    signerOrProvider: ethers.Signer | ethers.providers.Provider,
    contractAddress: string,
    abi: any[]
  ) {
    this.signerOrProvider = signerOrProvider;
    this.contract = new ethers.Contract(contractAddress, abi, signerOrProvider);
  }

  public setSigner(signer: ethers.Signer) {
    this.contract = this.contract.connect(signer);
  }

  public async hasDeposited(account: string): Promise<boolean> {
    return await this.contract.hasDeposited(account);
  }

  public async deposit(amount: number): Promise<ethers.providers.TransactionResponse> {
    // amount in whole tokens
    const amt = ethers.utils.parseUnits(amount.toString(), 18);
    return await this.contract.deposit({ value: amt });
  }
}
